import React, { useState } from "react";
import arrow from "./arrow.svg";

export default function Drawer({ isOpen }) {
  const disp = isOpen === true ? "none" : "block";
  return (
    <div
      className="drawer"
      style={{
        display: disp,
        zIndex: "3",
        position: "absolute",
      }}
    >
      <div
        style={{
          width: "450px",
          height: "640px",
          backgroundColor: "red",
        }}
      >
        <img src={arrow} className="icons" />
      </div>
    </div>
  );
}
